style.css:
@font-face {
          src: url(https://www.polestar.com/shared-assets/fonts/polestar-unica/regular.woff2) format('woff2'), url(https://www.polestar.com/shared-assets/fonts/polestar-unica/regular.woff) format('woff');
          font-family: Polestar Unica;
          font-weight: 400;
          font-style: normal;
          font-display: swap;
      }


html,
body,
div,
div div,
div div div,
yt-formatted-string, canvas, label, h1, h2, h3, h4, h5, h6, b, mw-headline, span, p, input, textare, blockqute, td, tbody, button, ul, li, a, ul a, li a, ul li a, div div p, yt-formatted-string, sup {
  font-family: "Polestar Unica" !important;
  letter-spacing: -0.01875rem;
  font-weight: inherit;
}
